import React, { useState } from 'react'
import { Link } from 'react-router-dom'

const Signup = () => {
    const [input, setInput] = useState({
        username: '',
        password: '',
        confirmPassword: '',
    })

    const [error, setError] = useState({
        username: '',
        password: '',
        confirmPassword: '',
    })
    const [rememberMe, setRememberMe] = useState(true)

    const myFunction = (e) => {
        setRememberMe(e.target.checked)
    }

    const inputChange = (e) => {
        const { name, value } = e.target
        setInput({
            ...input,
            [name]: value,
        })
        validateInput(e)
    }

    const validateInput = (e) => {
        let { name, value } = e.target
        setError({ ...error, [name]: value ? '' : 'Required field' })
        if (value && name.toLowerCase().includes('password')) {
            if (input.password !== input.confirmPassword)
                setError({ ...error, [name]: 'Password and Confirm Password does not match.' })
        }
    }

    return (
        <>
            <form className='form'>
                <fieldset style={{ border: '2px black solid', padding: '10px', width: '600px' }}>
                    <h2
                        style={{
                            textAlign: 'center',
                            fontSize: '40px',
                            color: 'black',
                        }}
                    >
                        <u>
                            <b> Sign Up </b>
                        </u>
                    </h2>
                    <p>
                        <label>Username:</label>
                        <input
                            type='text'
                            id='uname'
                            autoComplete='off'
                            placeholder='Username...'
                            value={input.username}
                            onChange={inputChange}
                            onBlur={validateInput}
                            name='username'
                        />
                        {error.username && (
                            <span className='err' style={{ color: 'red' }}>
                                {error.username}
                            </span>
                        )}
                    </p>
                    <p>
                        <label>Password:</label>
                        <input
                            type={showpsd}
                            className='psd'
                            value={input.password}
                            autoComplete='off'
                            placeholder='Password...'
                            onkeyup='passCheck(this.value)'
                            onChange={inputChange}
                            onBlur={validateInput}
                            name='password'
                        />
                        {error.password && (
                            <span className='err' style={{ color: 'red' }}>
                                {error.password}
                            </span>
                        )}
                    </p>
                    <p>
                        <label>Confirm Password:</label>
                        <input
                            type={showpsd}
                            value={input.confirmPassword}
                            className='psd'
                            autocomplete='off'
                            placeholder='Confirm your Password...'
                            onChange={inputChange}
                            onBlur={validateInput}
                            name='confirmPassword'
                        />
                        {error.confirmPassword && (
                            <span className='err' style={{ color: 'red' }}>
                                {error.confirmPassword}
                            </span>
                        )}
                        <br />
                        <input type='checkbox' onChange={myFunction} />
                        &nbsp; Show Password
                        <div>
                            <label className='password_check'>1 UPPERCASE Charachter</label>
                            <label className='password_check'>1 Special Charachter</label>
                            <label className='password_check'>1 Numerical Charachter</label>
                            Don't want to create account? Explore our&nbsp;
                            <Link to='./' style={{ textDecoration: 'none', color: 'orange' }}>
                                Home
                            </Link>
                            <br />
                            Already have an account?&nbsp;
                            <Link to='./login' style={{ textDecoration: 'none', color: 'green' }}>
                                Login
                            </Link>
                        </div>
                    </p>
                    <button
                        type='submit'
                        id='submit'
                        disabled={
                            !input.username
                                ? true
                                : false || !input.password
                                ? true
                                : false || !input.confirmPassword
                                ? true
                                : false || input.password === input.confirmPassword
                                ? false
                                : true
                        }
                    >
                        Sign Up
                    </button>
                    <button type='reset' id='reset'>
                        Reset
                    </button>
                </fieldset>
            </form>
